def data_processing_stress(number,writer2,remove_stress):
    
    print ('Starting data processing for stress values...')

    insert_mid = list(range(151312,151340))
    insert_front = [250084,250085,250108,250111,250137,250138,250163,250164]
    fwd_upper_aeroshell=[]
    fwd_lower_aeroshell=[]
