    parachute_comp=[]
    cargo_comp=[]
    columns = ['EID','PID','NORMAL 1','NORMAL 2','SHEAR 12','SHEAR XZ','SHEAR YZ','ANGLE','MAJOR','MINOR','SHEAR','SUBCASE']
    
    for stress in pd.read_csv('Rezultate-Elm-Stress.csv', dtype={'EID':int,'PID':int,'SHEAR XZ':float,'SHEAR YZ':float,'SUBCASE':int }, chunksize=number):

        stress = stress[~stress['EID'].isin(remove_stress)]
        ## groups
        #isin Command !!
        fwd_upper_aeroshell_stress=stress[stress['EID'].isin(magic_upper)]
