def main():
    start = time.time()
    intro = '''
    ----------------------------------------------------
      Space Rider Cold Structure F06 Extraction Script
    ----------------------------------------------------
                    - Version 2.11 -
	
	Added functions:
	- break f06 file in 2 separate SR and Stress files
	- insert all result data in database resultsData.db
	- use input_groups.txt as group numbering order
	- output excel file with results 
	- output word document with table results
	
    '''
    print (intro)
    input_fisier=input('Type the f06 file name:')
    analysis = input('What to extract from f06 file?  1-stress, 2-strength ratio, 3-both, input number:') 
    if analysis=='1':
        parse_stress(input_fisier)
    elif analysis =='2':
        parse_sr(input_fisier)
    elif analysis =='3':
        parse_stress(input_fisier)
        parse_sr(input_fisier)
    else:
        pass

    condition=input('Do you want to process SR or Stress data? 1-Strength Ratio, 2-Stress, 3-Both:')
    nr_elem=input('Insert number of finite elements in a case for Strength Ratio data:')
    nr_elem2=input('Insert number of finite elements in a case for Stress data:')
    removed = input('Insert list of elements that you want to remove from the analysis, if none - enter 1:')
    try:
        removed_list = [int(x) for x in removed.split(',')]
        print('List input is correct')
    except ValueError:
        input('Error: List of elements introduced contains an error, please check and try again!')
    
    writer = pd.ExcelWriter('Rezultate.xlsx', engine='xlsxwriter')
    print (condition)
    if condition == '1':
        data_processing_sr(int(nr_elem),writer,removed_list)
    elif condition == '2':
        data_processing_stress(int(nr_elem2),writer,removed_list)
    elif condition =='3':
        data_processing_sr(int(nr_elem),writer,removed_list)
        data_processing_stress(int(nr_elem2),writer,removed_list)
    else:
        print('Program Terminates!')

    writer.save()
    
    end = time.time()
    print ('Execution Time:')
    print (str(end - start)+' seconds') 
    input('Press Enter to close.')


if __name__ == '__main__':
    main()

    
